import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import {useEffect} from 'react';
import DeleteIcon from '@mui/icons-material/Delete';


function createData(id, name, description, elapsedTime, dateCompleted) {
  return { id, name, description, elapsedTime, dateCompleted };
}

let rows = [
  createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
  createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
  createData('Eclair', 262, 16.0, 24, 6.0),
  createData('Cupcake', 305, 3.7, 67, 4.3),
  createData('Gingerbread', 356, 16.0, 49, 3.9),
];

export default function BasicTable(props) {
    const [list, setList] = React.useState(props.list);
    const [loading, setLoading] = React.useState(true);

    useEffect( () => {
        if(props.list) {
            setList(props.list);
            console.log("List: " + props.list);
            rows = [];
            for(let i = 0; i < props.list.length; i++) {
                let task = props.list[i];
                const id = task.id;
                const name = task.name;
                const description = task.description;
                const elapsedTime = task.elapsedTime;
                const date = task.date;
                console.log(name);
                console.log(description);
                console.log(elapsedTime);
                console.log(date);
                rows.push(createData(id, name, description, elapsedTime, date));
            }
            setLoading(false);
        }


    },[props.rows]);

  return (
    <TableContainer component={Paper}>
      <Table sx={{ minWidth: 650 }} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>Task Name</TableCell>
            <TableCell>Description</TableCell>
            <TableCell align="right">Elapsed Time</TableCell>
            <TableCell align="right">Date Completed</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow
              key={row.name}
              sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >
              <TableCell component="th" scope="row">
                {row.name}
              </TableCell>
              <TableCell align="right">{row.description}</TableCell>
              <TableCell align="right">{row.elapsedTime}</TableCell>
              <TableCell align="right">{row.date}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
